svg.script:
var i = 0;
var frameCount = 36;
var playCount = 1;
var groups = [];
function StartAnimation(evt) {
	if (playCount === 0) return;
	groups = document.getElementsByTagName('g');
	groups[0].style.display = 'inline';
	window.setTimeout(Animate, groups[0].dataset.duration);
}
function Animate() {
	groups[i++].style.display = 'none';
	if (i === frameCount && playCount !== 0) {
		i = 0;
		if (playCount !== -1) playCount -= 1;
	}
	if (playCount === 0) return;
	groups[i].style.display = 'inline';
	window.setTimeout(Animate, groups[i].dataset.duration);
}
